import React from "react";
import Block from "../block/block";
import classes from './Box3x3.module.css'
const Box3x3 = ({click, boxid}) => {
    return (
        // Block№n
        // |  LT  T  RT |
        // |  L   M  R  |
        // |  LB  B  RB |
        <div className={classes.outer}>
        <div className={classes.block3x1}>
      <Block func={click} box_id={boxid} id={"LT"} state={''}/>
      <Block func={click} box_id={boxid} id={"T"} state={''}/>
      <Block func={click} box_id={boxid} id={"RT"} state={''}/>
      </div>
      <div className={classes.block3x1}>
      <Block func={click} box_id={boxid} id={"L"} state={''}/>
      <Block func={click} box_id={boxid} id={"M"} state={''}/>
      <Block func={click} box_id={boxid} id={"R"} state={''}/>
      </div>
      <div className={classes.block3x1}>
      <Block func={click} box_id={boxid} id={"LB"} state={''}/>
      <Block func={click} box_id={boxid} id={"B"} state={''}/>
      <Block func={click} box_id={boxid} id={"RB"} state={''}/>
      </div>  
        </div>
    );
};

export default Box3x3;
